import React, { useState, useEffect } from "react";
import axios from "axios";
import "../../styles/layout/layout.css";
import Header from "../../components/Header";
import Navigation from "../../components/Navigation";
import QuestionNoteList from "../../components/QuestionNoteList";
import {useParams } from "react-router-dom";


const HomeUnanswered = () => {

	const [number, setNumber] = useState(0);
	const getNumber = (number:number) => {
    setNumber(number);
  };
	const [questionList, setQuestionList] = useState<any[]>([]);
	const getQuestionList = (questionList:any) => {setQuestionList(questionList);};
	const [totalPages, setTotalPages] = useState<number>();
	const getTotalPages = (totalPages:any) => {
    setTotalPages(totalPages);
  };
	const [pageNumber, setPageNumber] = useState(0);
	const getPageNumberUp = (pageNumber:number) => {
    setPageNumber(pageNumber+1);
  };
	const getPageNumberDown = (pageNumber:number) => {
    setPageNumber(pageNumber-1);
  };
	const pageAddress = "unanswered";
	const { page } = useParams();

	useEffect(() => {
		axios
			.get("/home/unanswered/1")
			.then((res) => {
				console.log(res.data);
				setQuestionList(res.data.content);
				setTotalPages(res.data.totalPages);
				setPageNumber(res.data.number);
			})
			.catch((err) => {
				console.log(err);
			});
	}, []);
	

	return (
		<div className="container">
			{/* <PageLoad/> */}
			<Header />
			<p>{number}</p>
			<Navigation number={number} getNumber={getNumber} pageAddress={pageAddress} totalPages={totalPages} getTotalPages={getTotalPages} pageNumber={pageNumber} getPageNumberUp={getPageNumberUp} getPageNumberDown={getPageNumberDown} page={page} questionList={questionList} getQuestionList={getQuestionList}/>
			
			<div className="container-body">
				<QuestionNoteList questionList={questionList} />
			</div>
		</div>
	);
}

export default HomeUnanswered;
